import React from 'react';
import s from './Button.module.css';


type ComponentButtonType = {
nameButton:string;
started:()=>void;

}


export const Button = (props:ComponentButtonType) => {
    const Started = (nameButton:string)=>{
        props.started(nameButton)
    }
    return (

   <button className={props.nameButton === props.nameButton ? s.activeButton:''} onClick={()=>Started}>{props.nameButton}</button>

    );
};
